DROP TABLE IF EXISTS AIRPORT;
DROP TABLE IF EXISTS AIRLINE;

CREATE TABLE AIRPORT 
(
    Code	CHAR(3),
    Name	VARCHAR(512),
    City	VARCHAR(512),
    Country	VARCHAR(512),
    Latitude	DOUBLE,
    Longitude	DOUBLE,
    PRIMARY KEY (CODE)
);



CREATE TABLE AIRLINE 
(
    Code	CHAR(3),
    Name	VARCHAR(512),
    Callsign	VARCHAR(512),
    Country	VARCHAR(512),
    PRIMARY KEY (CODE)
);


